import React, { useEffect, useState } from "react";
import './Navbar.css';

  import hart from '../../assets/hart.png'
  import cart from '../../assets/cart.png'
  import logo from '../../assets/logo.png'
  import menu from '../../assets/menu.png'  
  import home from '../../assets/home.png'
  import account from '../../assets/account.png'
  import hexa from '../../assets/hexa.jpg'
  //import vegcutting from '../../assets/vegcutting.jpg'
  import iphone from '../../assets/iphon.jpg'
  import watch from '../../assets/watch.jpg'
  import {useNavigate, useNavigation} from 'react-router-dom'
  import axios from 'axios'
  


const Navbar = () => {

  const navigation = useNavigation();

  const [apidata,setapidata] = useState([])
  const [productData,setProductData] = useState([])

  const categoryData = async () => {
    const response = await axios.get("https://dummyjson.com/products/categories")
    setapidata(response.data)
  }

  const pData =async () => {
    const response = await axios.get("https://dummyjson.com/products")
    setProductData(response.data.products)
  }

  const navigateCategory = (item) => {
     switch(item) {
      case 'smartphone':
        smartPhone();
        navigation.navigate("Smar")
     }  
  }


  useEffect(()=> {
   categoryData()
   pData()
  },[])

  

  

  const dhars = useNavigate();

  const hartt = () => {
    dhars('/Hart') 
  }

  const cartt = () => {
    dhars('/Cart')
  }

  

  
  return (
    <>
      <div className="header">
        <div className="blogo">
        <img style={{width:130,height:70,marginTop:-30,}} src={logo} alt="ss" />
         </div>
        <div className="search">
           <form>
           <select>
              <option>All</option>
              <option>Home and Garden</option>
              <option>Shoes</option>
              <option>Watches</option>
              <option>Electronics components</option>
            </select>
            <input type="text" placeholder="Search for products"></input>
            <button>Go</button><br></br><br></br>
              <a href="/#">Gift Shop</a>&nbsp;&nbsp;
              <a href="/#">Become a seller</a>&nbsp;&nbsp;
              <a href="/#">Special offers</a>&nbsp;&nbsp;
              <a href="/#">Buyer protection</a>
          </form>
        </div> 
        
        <div className="icons">
         
      <img  style={{width:40,height:30,alignItems:"center"}} src={hart} alt="h" onClick={hartt} />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <img  style={{width:40,height:30,alignItems:"center"}} src={cart} alt="l" onClick={cartt} />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <div className="dicons">
      <img style={{width:40,height:30,alignItems:"center",}} src={account} alt="sss"/>&nbsp;&nbsp;&nbsp;
      <select style={{backgroundColor:"none",outline:"none",border:"none"}}>
      <option>My account</option>
      <option>My order</option>
      <option>My massage</option>
      </select></div>
      </div>
</div>

{/* <div className="categoriess">
<img style={{width:30,height:20,marginTop:-30,paddingLeft:100,paddingTop:100}} src={menu} alt="ss" />&nbsp;
<span style={{paddingTop:68}}>Categories </span>
</div> */}



{/* navbar ke niche ki coding */}
<div className="secpage">
<div className="cat">
<div style={{flexDirection:"row",alignItems:"center",display:'flex',marginTop:60,marginLeft:60}}>
<img style={{width:30,height:30,marginLeft:10}} src={menu} alt="ss"/>&nbsp;&nbsp;
 <b><span>Categories</span></b>
 </div>
 {
  apidata.map((item,index) => (
    <button onClick={() => navigateCategory(item)}  key={index} style={{marginTop:15,marginLeft:77}}>
    <div style={{flexDirection:"row",display:"flex"}}>  
    <img style={{width:20}} src={home} alt="d"/>&nbsp;&nbsp;&nbsp;&nbsp;
    <a href="../src" style={{alignItems:"center",textDecoration:"none", color:"black"}}>{item}</a>
    </div>
    </button>
  ))
}
</div>

<div
        id="carouselExampleFade"
        className="carousel slide carousel-fade"
        data-bs-ride="carousel"
        style={{ objectFit: "contain !important" }}
      >
        <div className="carousel-inner" id="carousel">
          <div className="carousel-item active">
            <img
              src={hexa} alt="pp"
              className="d-block w-100"
              style={{ filter: "brightness(80%) ", marginTop:100,marginLeft:170,width:800 }}
              />
          </div>
          
          
       
         <div className="compoimage">
       {
          productData.map((item)=>(
          <button key={item.id} style={{width:300,marginLeft:170,marginTop:40,height:400,border:"none",borderStyle:"groove", backgroundColor:"white",borderRadius:15}}>  
          <div style={{display:"flex",flexDirection:"column",alignItems:"center"}}>
          <img style={{borderStyle:"groove",borderRadius:15,height:250,width:150}} src={item.thumbnail} alt="iphne11"/>&nbsp;&nbsp;
          </div>
          <span style={{fontSize:25}}>{item.title}</span><br></br>
          <span style={{color:"orangered",fontSize:25}}>{item.price}</span>
          </button>
          ))
        } 

         
        {/* <img style={{marginLeft:59,marginTop:50}} src={iphone} alt="iphne11"/>
        <img style={{marginLeft:59,marginTop:50}} src={iphone} alt="iphne11"/>
        <img style={{marginLeft:59,marginTop:50}} src={iphone} alt="iphne11"/> */}
         </div>   
          
          {/* <div className="carousel-item active">
            <img
              src={vegcutting} alt="ap"
              className="d-block w-100"
              style={{ filter: "brightness(80%) ", marginTop:100,marginLeft:60,width:800}}
              />
          </div> */}
          </div>
          </div>
      
       
          


          </div>     
</>
);
};

export default Navbar;
